import { connect } from 'react-redux'
import {  } from '../../redux/actions/users.js'
import ReactMapboxGl, { Layer, Feature } from "react-mapbox-gl";

const Map = ReactMapboxGl({
  accessToken: "pk.eyJ1IjoicnRyYW0iLCJhIjoiY2pxeHdwMDYwMDMzaDN4cHB6bW95ZHNqeSJ9.UEwgGPHUbB4g8DA-pm74sA"
});


class CasinoMap extends Component {

  render() {

    return(
      <Map
        style="mapbox://styles/mapbox/streets-v9"
        containerStyle={{
          height: "750vh",
          width: "750vw"
        }}>
          <Layer
            type="symbol"
            id="marker"
            layout={{ "icon-image": "marker-15" }}>
            <Feature coordinates={[-77.009003, 38.889931
]}/>
          </Layer>
      </Map>
    )
  }
}


export default connect(null, {  })(CasinoMap);
